    //     response.json();
    //   })
    //   .then((response) => setResp(response))
    //   .catch((err) => {
    //     console.log(err);
    //   });
    fetch(
      "https://dark-sky.p.rapidapi.com/41.619549,-93.598022?lang=en&units=auto",
      {
        method: "GET",
        headers: {
          "x-rapidapi-host": "dark-sky.p.rapidapi.com",
          "x-rapidapi-key":
            "bceb01c09emsh7333c7d8acd9bbfp114330jsn9662e80626cf",
        },
      }
    )
      .then((response) => {
        console.log(response);
      })
      .catch((err) => {
        console.log(err);
      });
  }
  function getCurrentForecast() {
    fetch(
      "https://community-open-weather-map.p.rapidapi.com/weather?callback=test&units=%2522imperial%2522&q=Des%20Moines",
      {
        method: "GET",
        headers: {
          "x-rapidapi-host": "community-open-weather-map.p.rapidapi.com",
          "x-rapidapi-key":
            "bceb01c09emsh7333c7d8acd9bbfp114330jsn9662e80626cf",
        },
      }
    )
      .then((response) => {
        currentCast = response.json();
        console.log(currentCast);
      })
      .catch((err) => {
        console.log(err);
      });
  }
  getFiveDayCast();
  // setInterval(getFiveDayForecast, 10000);
  // setInterval(getCurrentForecast, 20000);

  return (
    <div>
      <Card>
        <Card.Body>
          <Card.Title>YO</Card.Title>
          <Card.Text>{JSON.stringify(fiveDayCast)}</Card.Text>
        </Card.Body>
      </Card>
    </div>
  );
};

export default Weather;
